## About Junnan

Hi, Im Junnan, an undergraduate in Data Science & Statistics at UCLA.

My life has been shaped by turning points and restartsfrom moving between cities in childhood, to switching from humanities to STEM, to restarting my college path in the U.S.

At community college, I rebuilt from zero: I founded the Math Club, organized competitions, and served as a Student Services Senator, graduating with a 3.97 GPA.\
This led me to UCLA, where I now maintain a 3.7 GPA while pursuing my passion for statistics, data science, and machine learning.

Through two ongoing research positions, I apply data methods in medicine, the social sciences, and advanced machine learning.\
Each experience deepens my interest in data-driven research and strengthens my goal of continuing to graduate study in data science and statistics.

